  false,\n\t\"url\": null,\n\t\"notes\": \"The objectives of the Rappahannock River
  Valley National Wildlife Refuge are: to preserve and enhance the refuge's lands
  and water in a manner that will conserve the natural diversity of fish, wildlife,
  plants, and their habitats for present and future generations; to protect, restore,
  and enhance ecologically significant wetland habitats; to conserve and enhance populations
  of fish, wildlife, and plants within refuge boundaries; to manage and perpetuate
  the migratory bird resource including populations of  waterfowl, neotropical migrants,
  raptors, passerines and marsh and waterbirds. This report outlines how the biological
  plans for 2002-03 will use these objectives as a guideline.\",\n\t\"license_title\":
